        }
    }

    render() {
        return (
            <div className="menuStyle">
                <Link href='/'>
                    <a style={linkStyle}>Home</a>
                </Link>
                <Link href='/list'>
                    <a style={linkStyle}>List</a>
                </Link>

                <div className="searchInMenu">
                    <SearchList />
                </div>
                <div className="cartInMenu">
                    <Link href='/cart'>
                        <a style={linkStyle}><CartIcon /></a>
                    </Link>
                </div>
            </div >
        )
    }
}
